import React from "react";
import { Button} from "reactstrap";

const Stadium = () => {
  return (
    <div>
      <h1>Stadium Name</h1>
      <img src="defaultStadium.jpg"></img>
      <h3>Governorate</h3>
      <h4>City</h4>
      <div>
      <Button
        block
        color="success"
        onClick={toggle}
        style={{ marginBottom: "1rem", marginTop: "1rem" }}
      >
        Day
      </Button>
      <Collapse isOpen={isOpen}>
        <h2>10-12</h2>
        <h2>12-14</h2>
        <h2>14-16</h2>
        <h2>16-18</h2>
        <h2>18-20</h2>
        <h2>20-22</h2>
        <h2>22-00</h2>
      </Collapse>
    </div>
    </div>
  );
};

export default Stadium;
